                Donation Succesfull
              </Alert.Heading>
            </Alert>

            <Card.Body>
              <h4>Thank you for donation</h4>
              <br></br>
              <div align="center">
                <Button
                  className="d-flex justify-content-right"
                  onClick={() => {
                    navigate("/");
                  }}
                  variant="success"
                >
                  Next
                </Button>
              </div>
            </Card.Body>
          </Card>
        </div>
      </div>
    </>
  );
}

export default Success;
